syntax = "proto3";
package build;




import "model/pipeline/progress_log.proto";

/*
AppendProgressLogApi返回
*/
message AppendProgressLogResponseWrapper {
    /*
    返回码
    */
    int32 code = 1 ;
    /*
    返回码解释
    */
    string codeExplain = 2 ;
    /*
    错误详情
    */
    string error = 3 ;
    /*
    返回数据
    */
    pipeline.ProgressLog data = 4 ;
}

